import React, { Component } from "react";
import OneCarCard from "./OneCarCard";
import OneFriendCard from "./OneFriendCard";
import NavBar from "./NavBar";
import { NavLink } from "react-router-dom";

class Cars extends Component {
    state = {
        myCars:
            [
                {
                    make: "Kia",
                    model: "Sorento",
                    year: 2020
                },
                {
                    make: "Kia",
                    model: "Optima",
                    year: 2019
                },
                {
                    make: "Tesla",
                    model: "Model 3",
                    year: 2021
                },
                {
                    make: "Honda",
                    model: "Civic",
                    year: 2019
                },
                {
                    make: "Honda",
                    model: "Accord",
                    year: 2018
                },
                {
                    make: "Volkswagen",
                    model: "Jetta",
                    year: 2021
                },
                {
                    make: "Toyota",
                    model: "Camry",
                    year: 2021
                },
                {
                    make: "Ford",
                    model: "Mustang",
                    year: 2019
                },
                {
                    make: "Ford",
                    model: "F-150",
                    year: 2019
                },
                {
                    make: "Toyota",
                    model: "Camry",
                    year: 2020
                },
                {
                    make: "Ford",
                    model: "F-150",
                    year: 2021
                }
            ],
        anArray: [1, 2, 3]
    }

    onShowButtonClicked = (e) => {
        console.log("you want to show cars")
    }

    mappedCars = () => {
        this.state.myCars.map(this.mapCar)

        return this.mappedCars;
    }

    mapCar = (oneCar) => {
        return (
            <OneCarCard
                make={oneCar.make}
                model={oneCar.model}
                year={oneCar.year}
            />
        )
    }


    render() {
        return (
            <React.Fragment>
                <NavBar />
                <div
                    className="jumbotron jumbotron-fluid"
                    id="carsJumbo"
                >
                    <div className="container">
                        <h1
                            className="display-3"
                            style={{ color: "white" }}
                        ><strong>Your Cars</strong></h1>
                        <p
                            className="lead"
                            style={{ color: "white" }}
                        >
                            <strong id="listFriendsHeader">Below, a list of all your current Cars <NavLink to="/carFrom">Click here to add a New Car</NavLink></strong>
                        </p>

                    </div>
                </div>
                <div className="col-md-12 p-0">
                    <button
                        type="button"
                        className="btn btn-outline-info "
                        onClick={this.onShowButtonClicked}
                    >Show Cars</button>
                    <hr />
                    <div className="row">

                        {this.state.myCars.map(this.mapCar)}
                    </div>
                </div>
            </React.Fragment>
        )
    }
}

export default Cars;
